import { TRightMenuItem, TRightSubMenu } from "~/interfaces/menu";

const menuItems: TRightMenuItem[] = [
  {
    title: "Button",
    props: [
      {
        name: "children",
        default: null
      },
      {
        name: "classes",
        default: null
      },
      {
        name: "color",
        default: "default"
      },
      {
        name: "component",
        default: "button"
      },
      {
        name: "disabled",
        default: false
      },
      {
        name: "disableElevation",
        default: false
      },
      {
        name: "disableFocusRipple",
        default: false
      },
      {
        name: "disableRipple",
        default: null
      },
      {
        name: "endIcon",
        default: null
      },
      {
        name: "fullWidth",
        default: false
      },
      {
        name: "href",
        default: null
      },
      {
        name: "size",
        default: "medium"
      },
      {
        name: "startIcon",
        default: null
      },
      {
        name: "variant",
        default: "text"
      }
    ]
  },
  {
    title: "Paper",
    props: [
      {
        name: "children",
        default: null
      },
      {
        name: "classes",
        default: null
      },
      {
        name: "component",
        default: "div"
      },
      {
        name: "elevation",
        default: 1
      },
      {
        name: "square",
        default: false
      },
      {
        name: "variant",
        default: "elevation"
      }
    ]
  }
];

const rightSubMenus: TRightSubMenu[] = [
  {
    iconType: "aliwangwang",
    title: "プロパティ",
    menuItems: menuItems
  }
];

export default rightSubMenus;
